import React from 'react';
import { Table } from 'react-bootstrap';

export default class MyTable extends React.Component {
  render() {
    return (
      <Table responsive>
        <thead>
          <tr>
            <th>Nume</th>
            <th>Categorie</th>
            <th>Dată</th>
            <th>Sumă</th>
          </tr>
        </thead>
      </Table>
    );
  }
}
